import React from 'react';

const RestaurateurDashboard = () => {
  return (
    <div>
      <h1 className="text-3xl font-bold mb-6">Tableau de bord Restaurateur</h1>
      <p>Bienvenue sur votre espace restaurateur. Cette page est en construction.</p>

      <div className="bg-yellow-100 border border-yellow-400 text-yellow-700 p-4 mt-4 rounded">
        <p>Ce module sera bientôt disponible. Vous pourrez gérer vos restaurants, menus et commandes.</p>
      </div>
    </div>
  );
};

export default RestaurateurDashboard;
